INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(1, 'Derecho administrativo mínimo', 'José Ramón Chaves', 'Compendio del conocimiento jurídico general de la organización y funcionamiento del poder público, que sería el mínimo que debería dominarse al graduarse en derecho, el mínimo para obtener plaza de cuerpos jurídicos y el mínimo para sobrevivir como abogado en lo contencioso-administrativo.', 780, 'Derecho', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(2, 'Croata', 'Jorge García García', 'Croata, utilizando la arrolladora fuerza de sus personajes, sube a las más altas esferas de la sociedad para mostrarnos las mayores bajezas del ser humano. Lo hace en una época, la actual, y en un mundo ridículo y corrupto donde los conceptos bueno y malo se muestran a menudo solapados.', 374, 'Novela', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(3, 'El libro del azafrán', 'Jesús Ávila Granados', 'La presente obra, estamos seguros, ayudará al lector a acercarse un poco más a los encantos y misterios de esta planta, convirtiéndose, por otra parte, en una interesante y amena guía para descubrir nuevos placeres culinarios y reposteros.', 184, 'Cultura', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(4, 'El legado de los malditos', 'Vanesa Redondo', 'Novela histórica. La gran obra de narrativa de la escritora Vanesa Redondo. Uno de los misterios arquitectónicos mejor guardados por la Iglesia y por los antiguos reyes de Castilla.', 626, 'Novela', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(5, 'El silencio de la lengua', 'Luis Melero Marcos', 'Transitar por los angostos espacios de la poesía, es como mirar al abismo donde el caminante puede despeñar su realidad, urgir el abandono y hundirse, siempre con dolor, en lo más profundo del ser. Vaciarse para descubrir, en la ausencia, toda la inmediatez de su agonía, todo el miedo a la nada que duerme.', 108, 'Poesia', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(6, 'La mujer del otro', 'José Navarro Ballesteros', 'Editorial Amarante presenta la última obra del escritor almeriense José Navarro quien vuelve a sorprendernos con su impagable caleidoscopio de personajes y narraciones memorialísticas. En esta ocasión \"La mujer del otro\" se convierte en la novela que más protagonismo le da a su personaje “alter ego” Fabián Cartujano.', 208, 'Novela', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(7, 'Lo inefable del amor', 'Sara Carballal', 'A veces el para siempre dura un poco menos, pero no por ello se convierte en mentira. Esta historia es un viaje a la concepción de un amor, un elogio a los buenos momentos mientras se plantea el devenir de la pareja. Porque, ¿y si el para siempre es más verdad si se sabe frenar a tiempo?', 90, 'Poesia', 'No disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(8, '¿CÓMO PIERDO PESO? Tengo una aminoacidopatía', 'Aline Leonardo', 'Editorial Amarante presenta \"Cómo pierdo peso? Tengo una aminoacidopatía\", el último libro de la nutróloga Aline Leonardo, autora entre otras obras de: \"Gluten, el monstruo de las galletas\" y \"Desayunos y meriendas sin gluten, sin huevo y sin leche\".', 114, 'Alimentacion', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(9, 'Los Estados Unidos de Europa explicados a todos (Guía para perplejos)', 'Michele Ballerin', 'Después del éxito que ha tenido en Italia \"Los Estados Unidos de Europa explicados a todos. Guía para perplejos\" era necesario que viera la luz en España, pues el libro de Ballerin nos ayuda a comprender mejor la naturaleza, la morfología y el significado profundo del proyecto europeo.', 124, 'Politica', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(10, 'Versos desvelados', 'Laura Martínez Gimeno', '\"Versos Desvelados\" es una recopilación de poemas de carácter gótico y romántico. El poemario trata un gran abanico de temas', 86, 'Poesia', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(11, 'Hijos del fuego', 'Joaquín Castillo', 'Editorial Amarante presenta \"Hijos del fuego\", el culmen de la trilogía de Joaquín Castillo.', 450, 'Novela', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(12, 'Mujeres en el agua', 'Patricia Torres', 'Última obra ilustrada de Patricia Torres', 276, 'Relatos', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(13, 'Churras y Merinas (Visiones, impresiones, realidades)', 'Román Álvarez', 'Reflexiones que fueron apareciendo a lo largo de seis años en columnas semanales del periódico \"La Gaceta Regional de Salamanca\" con el título genérico de “Churras y merinas” ', 398, 'Periodismo', 'Disponible', );
INSERT INTO `libros` (`id_libro`, `titulo`, `autor`, `descr`, `paginas`, `genero`, `estado`, `portada`) VALUES
(15, 'Burla burlando. Las diversiones de los universitarios en el siglo XVI', 'Alberto del Campo Tejedor', 'Un largo diálogo entre dos estudiantes, compañeros de la Universidad de Salamanca', 172, 'Ensayo', 'Disponible', );
